import React from 'react';

let notesData = [
    {
        id: 1,
        noteTitle : "True",
        noteContent : "That's right",
    },
    {
        id: 2,
        noteTitle : "Constantine",
        noteContent : "The greek god",
    },
    {
        id: 3,
        noteTitle : "Gomamon",
        noteContent : "Yes, gomamon",
    },
    {
        id: 4,
        noteTitle : "Gomamon",
        noteContent : "Yes, gomamon",
    }
]

export default notesData;
